import React, { Component } from "react";
import "popper.js";
import "bootstrap/dist/js/bootstrap";
import "bootstrap/dist/css/bootstrap.css";
import "../index.css";
const species = require("../data/species.json");

var selected;

function changeSpecies(target) {
    // console.log(this.refs.commonName);
    console.log(React.createRef);
}

class Species extends Component {
    render() {
        return (
            <div
                className="container-fluid mb-2"
                style={{
                    position: "absolute",
                    height: "calc(100% - 72px)",
                    bottom: "8px"
                }}
            >
                <div
                    id="outer-grid"
                    className="h-100"
                    style={{
                        display: "grid",
                        gridTemplateColumns: "repeat(3, 1fr)",
                        gridTemplateRows: "repeat(5, 1fr)"
                    }}
                >
                    {/* Row 1 */}
                    <div
                        className="border h-100"
                        style={{
                            display: "grid",
                            gridTemplateRows: "1fr 0 1fr"
                        }}
                    >
                        <div id="common-name" ref="commonName">
                            <h6 className="cell-name">Common Name: </h6>
                            <div className="cell-content dropdown">
                                <select
                                    id="common-name-selector"
                                    className="form-control"
                                    onChange={changeSpecies(selected)}
                                >
                                    <option value="">
                                        Select by Common Name
                                    </option>
                                    {species.data.species.map(selection => {
                                        return (
                                            <option
                                                value={selection.common_name}
                                                key={selection.id}
                                            >
                                                {selection.common_name}
                                            </option>
                                        );
                                    })}
                                </select>
                            </div>
                        </div>
                        <hr className="m-0" />
                        <div id="latin-name" ref="latinName">
                            <h6 className="cell-name">Latin Name: </h6>
                            <div className="cell-content dropdown">
                                <select
                                    id="latin-name-selector"
                                    className="form-control"
                                    onChange={changeSpecies(selected)}
                                >
                                    <option value="">
                                        Select by Latin Name
                                    </option>
                                    {species.data.species.map(selection => {
                                        return (
                                            <option
                                                value={selection.latin_name}
                                                key={selection.id}
                                            >
                                                {selection.latin_name}
                                            </option>
                                        );
                                    })}
                                </select>
                            </div>
                        </div>
                    </div>
                    <div
                        className="border h-100"
                        style={{
                            display: "grid",
                            gridTemplateRows: "1fr 0 1fr 0 1fr"
                        }}
                    >
                        <div id="" ref="">
                            abc
                        </div>
                        <hr className="m-0" />
                        <div id="" ref="">
                            abc
                        </div>
                        <hr className="m-0" />
                        <div id="" ref="">
                            abc
                        </div>
                    </div>
                    <div
                        id="conservation-status"
                        className="border h-100"
                        ref="conservationStatus"
                    >
                        abc
                    </div>
                    {/* Row 2 */}
                    <div id="description" className="border h-100" ref="">
                        abc
                    </div>
                    <div
                        id="images"
                        className="border h-100"
                        ref="images"
                        style={{
                            gridArea: "2 / 2 / 4 / 4"
                        }}
                    >
                        abc
                    </div>
                    {/* Row 3 */}
                    <div id="" className="border h-100" ref="">
                        abc
                    </div>
                    {/* Row 4 */}
                    <div id="diet" className="border h-100" ref="diet">
                        abc
                    </div>
                    <div
                        id="map"
                        className="border h-100"
                        ref="map"
                        style={{ gridArea: "4 / 2 / 6 / 3" }}
                    >
                        abc
                    </div>
                    <div
                        id=""
                        className="border h-100"
                        ref=""
                        style={{ gridArea: "4 / 3 / 6 / 4" }}
                    >
                        abc
                    </div>
                    {/* Row 5 */}
                    <div id="habitat" className="border h-100" ref="habitat">
                        abc
                    </div>
                </div>
                <style>
                    {
                        "\
                        #outer-grid div {\
                            padding: 4px;\
                        }\
                    "
                    }
                </style>
            </div>
        );
    }
}

export default Species;
